import React, { useState } from 'react';
import { BrowserRouter as Router, Routes , Route, Link } from "react-router-dom";

function Home() {
    return (  
        <div className="App">
                    <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>
        <h1>HOME</h1>
        </div>
    );
}

export default Home;
